import React from 'react';
import Post from "./Post/Post";
import LoginPostFormRedux from "./FormPost";

const MyPost = (props) => {

    let PostMass = props.posts.map(p => <Post message={p.text} key={p.id} like={p.like}/>)
    let onSubmit = (formData) => {
        console.log(formData)
        alert(props.newPostText)
        props.onaddDialogs()
    }
    let OnPostChange = (e) => {
        let text = e.target.value
        props.onPostChange(text)
    }
    
    return (
        <div>
            <div>
               <LoginPostFormRedux onSubmit={onSubmit}  OnPostChange={OnPostChange} newPostText={props.newPostText} />
            </div>
            {PostMass}
        </div>
    );
}
export default MyPost;
